//declaring constructor

contract Mycontract{
    uint a;
    constructor(uint _a)public {
        a = _a;
    }
}

//admin pattern
pragma solidity ^0.5.11;
contract Mycontract1{
    uint a;
    address admin;
    constructor(uint _a)public {
        admin = msg.sender;
    }
}

//calling parent constructor

pragma solidity ^0.5.11;
contract MyParentcontract1{
    uint a;
    address admin;
    constructor(uint _a)public {
        admin = msg.sender;
    }
}

